import React from "react";
import ClientsImg from "../images/ClientsImg.png";
import Box from "@mui/material/Box";
function ClientsBanner() {
  return (
    <Box
      sx={{
        backgroundColor: "white",
        display: { xs: "flex" },
        //justifyContent: "",
        alignItems: "center",
        padding: 1,
      }}
    >
      <img src={ClientsImg}></img>
    </Box>
  );
}

export default ClientsBanner;
